import {Box, Text} from 'native-base'

import AppButton from '../Components/AppButton'


function LoginSreen() {
  return (
    // <div>LoginSreen</div>
    <Box>
        {/* <Text>
        </Text> */}
        <AppButton color="#sss696" title="ini LoginScreen.js" />
    </Box>
  )
}

export default LoginSreen
